import React, { useState, useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
import HideAppBar from "./components/AppBar";
import RecipeReviewCard from "./components/CityCard";

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(
      "http://api.openweathermap.org/data/2.5/forecast?id=524901&APPID=62029f0d3701271a5e50142b280915f0"
    )
      .then((res) => res.json())
      .then(
        (result) => {
          setData(result.data);
        }
      );
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <HideAppBar />
        <a>{data}</a>
        <a>fad</a>
      </header>
    </div>
  );
}

export default App;
